import './App.css';
import CsvFile from './components/ImportCsv';
import Table from './components/ExtractCsvTable';

function App() {
 const [items,setItems] = useState();
  return (
    <div className="App">
     <CsvFile tableData={items=>setItems(items)}></CsvFile>
     <Table></Table>
    </div>
  );
}

export default App;
